  let [alphabet, setAlphabet] = useState(enAlphabet)
  let l = 5
  let r = 5
  return (
    <div className="hangman">
      <Settings rows={r}/>
      <Scores scores="100" />
      <Solution length={l}/>
      <Letters rowNum={r} alphabet={alphabet.letters}/>
    </div>
  );
}

export default App;
